import * as React from 'react';
import {Button,Text,View} from 'react-native';
import {NavigationContainer} from '@react-navigation/native';
import {createNativeStackNavigator} from '@react-navigation/native-stack';
import CountChange from './CountChange';
import KeyPad from './KeyPad';
import ToDoList from './ToDoList';
import NoteTaker from './NoteTaker';

const Stack = createNativeStackNavigator();

const HomeScreen = ({navigation}) => {
    return (
     <View style={{ flexDirection:'column'}}>
            <View style={{flexDirection: 'row',
                          justifyContent:'space-evenly'}}>
              <Button
                title= "ToDoList"
                onPress = {()=>
                navigation.navigate('ToDoList')
                }
              />
              <Button
                title= "NoteTaker"
                onPress = {()=>
                navigation.navigate('NoteTaker')
                }
              />
            </View>
            <View style={{alignSelf: 'center',
                          flexDirection: 'row'}}>
              <Text style={{fontSize: 20,
                            marginTop: 20}} >
                  　／l、 <br/> 
                  （ﾟ､ 。 ７ <br/> 
                   　l、 ~ヽ <br/> 
                  　じしf_, )ノ<br/> 
              </Text>
            </View>
      </View>
    );
  };

const FeedButton = () => {
  const [catFood, setCatfood] = useState(5);
  return (
    <View>
      <Text>
        You have {catFood} catfood. 
      </Text>
      <Button>
        onPress={() => {
            setCatfood(catFood-1);
          }}
        title={'Feed me moooooore'}
        color='#BBBBF0'
      </Button>
    </View>
  )
}

const MyStack = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={HomeScreen}
          options={{title: 'Welcome'}}
        />
        <Stack.Screen name="Profile" component={ProfileScreen} />
        <Stack.Screen name="CountChange" component={CountChange} />
        <Stack.Screen name="KeyPad" component ={KeyPad} />
        <Stack.Screen name="ToDoList" component ={ToDoList} />
        <Stack.Screen name="NoteTaker" component ={NoteTaker} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default MyStack;
